// SPDX-License-Identifier: GPL-3.0
pragma solidity ^0.8.11;

import "./IERC721.sol"; // interface to be extended
import "./IERC721Receiver.sol"; // III
import "./OwlCatOwner.sol";

contract OwlCatContract is IERC721, OwlCatOwner {

  uint256 public constant CREATION_LIMIT_GEN0 = 10;
  string public constant _name = "OwlCatsFactory";
  string public constant  _symbol = "OCF";

  bytes4 internal constant MAGIC_ERC721_RECEIVED = bytes4(keccak256("onERC721Received(address,address,uint256,bytes)")); // III

  /* IV
  *    bytes4(keccak256('balanceOf(address)')) == 0x70a08231
  *    bytes4(keccak256('ownerOf(uint256)')) == 0x6352211e
  *    bytes4(keccak256('approve(address,uint256)')) == 0x095ea7b3
  *    bytes4(keccak256('getApproved(uint256)')) == 0x081812fc
  *    bytes4(keccak256('setApprovalForAll(address,bool)')) == 0xa22cb465
  *    bytes4(keccak256('isApprovedForAll(address,address)')) == 0xe985e9c5
  *    bytes4(keccak256('transferFrom(address,address,uint256)')) == 0x23b872dd
  *    bytes4(keccak256('safeTransferFrom(address,address,uint256)')) == 0x42842e0e
  *    bytes4(keccak256('safeTransferFrom(address,address,uint256,bytes)')) == 0xb88d4fde
  * 
  *    => 0x70a08231 ^ 0x6352211e ^ 0x095ea7b3 ^ 0x081812fc ^ 
  *       0xa22cb465 ^ 0xe985e9c5 ^ 0x23b872dd ^ 0x42842e0e ^ 0xb88d4fde == 0x80ac58cd 
  */

  bytes4 private constant _INTERFACE_ID_ERC721 = 0x80ac58cd; //IV

  /*
  *   bytes4(keccak256('supportsInterface(bytes4)')); 
  */

  bytes4 private constant _INTERFACE_ID_ERC165 = 0x01ffc9a7; // IV
  //receipt to the front-end
  event Birth(  
    address owner, 
    uint256 owlCatId, 
    uint256 mumId, 
    uint256 dadId, 
    uint256 genes);

  struct OwlCat {
    uint32 mumId;
    uint32 dadId;
    uint16 generation;
    uint256 genes;
    uint64 birthTime;
  }

  OwlCat[] owlCats;

  mapping (uint256 => address) public owlCatIndexToOwner;
  mapping (address => uint256) ownershipTokenCount;

  mapping (uint256 => address) public owlCatIndexToApproved; // II
  mapping (address => mapping (address => bool)) private _operatorApprovals; // II

  uint256 public gen0Counter;

  constructor() { // to avoid the case of OwlCat 0 that no one owns
    _createOwlCat(0, 0, 0, type(uint256).max, address(0)); // uint256(-1) deprecated for max value
  }

  function breed(uint256 _dadId, uint256 _mumId) public { // V
    require(_owns(msg.sender, _dadId), "The user doesn't own the token");
    require(_owns(msg.sender, _mumId), "The user doesn't own the token");

    (,,uint256 DadGeneration,uint256 dadDna,) = getOwlCat(_dadId); // reducing memory use ,,,,
    (,,uint256 MumGeneration,uint256 mumDna,) = getOwlCat(_mumId);

    uint256 newDna = _mixDna(dadDna, mumDna);

    uint256 kidGen = 0;
      if(DadGeneration < MumGeneration){
        kidGen = MumGeneration + 1;
        kidGen /= 2;
      } else if (DadGeneration > MumGeneration){
        kidGen = DadGeneration + 1;
        kidGen /= 2;
      } else {
        kidGen = MumGeneration + 1;
      }

      _createOwlCat(_mumId, _dadId, kidGen, newDna, msg.sender);
  }

  function supportsInterface(bytes4 _interfaceId) external pure returns (bool){
    return ( _interfaceId == _INTERFACE_ID_ERC721 ||  _interfaceId == _INTERFACE_ID_ERC165 );
  }

  function createOwlCatGen0(uint256 _genes) public onlyOwner returns(uint256){
    require(gen0Counter < CREATION_LIMIT_GEN0, "Gen0 OwlCats limit reached !");

    gen0Counter++;

    return _createOwlCat(0, 0, 0, _genes, msg.sender);
  }

  function _createOwlCat(
    uint256 _mumId,
    uint256 _dadId,
    uint256 _generation,
    uint256 _genes,
    address _owner
  ) private returns(uint256) {  //for instance not internal because not inherited

    OwlCat memory _owlCat = OwlCat({
      mumId: uint32(_mumId),
      dadId: uint32(_dadId),
      generation: uint16(_generation),
      genes: _genes,
      birthTime: uint64(block.timestamp) // "now" DEPRECATED
    });

    uint256 newOwlCatId; 

    owlCats.push(_owlCat);  // push returns the length DEPRECATED
    newOwlCatId = owlCats.length - 1;

    emit Birth(_owner, newOwlCatId, _mumId, _dadId, _genes); // receipt to the front-end

    _transfer(address(0), _owner, newOwlCatId); // ojo por esto no queda en balance

    return newOwlCatId;

  }

  /* function getOwlCat(uint256 tokenId) external view returns(OwlCat memory owlcat){ // return strings
     owlcat = owlCats[tokenId];
  } */

  function getOwlCat(uint256 tokenId) public view returns(  // return BN, V change external to public
    uint256 mumId,
    uint256 dadId,
    uint256 generation,
    uint256 genes,
    uint256 birthTime
  )
  {
    OwlCat storage owlcat = owlCats[tokenId];

    mumId = uint32(owlcat.mumId);
    dadId = uint32(owlcat.dadId);
    generation = uint16(owlcat.generation);
    genes = owlcat.genes;
    birthTime = uint64(owlcat.birthTime);

  }

  function balanceOf(address owner) external view returns (uint256 balance){    
    balance =  ownershipTokenCount[owner];
  }

  function totalSupply() external view returns (uint256 total){  //could be public
    total = owlCats.length;
  }

  function name() external pure returns (string memory tokenName){
    tokenName = _name;
  }

  function symbol() external pure returns (string memory tokenSymbol){
    tokenSymbol = _symbol;
  }

  function ownerOf(uint256 tokenId) external view returns (address owner){
    owner = owlCatIndexToOwner[tokenId];
  }

  function transfer(address to, uint256 tokenId) external{
    require(to != address(0));
    require(to != address(this));
    require(_owns(msg.sender, tokenId));

    _transfer(msg.sender, to, tokenId);

  }

  function _transfer(address from, address to, uint256 tokenId) internal {
    ownershipTokenCount[to]++; // no aumenta balance del pues "to" es "address(0)"

    owlCatIndexToOwner[tokenId] = to;

    if(from != address(0)){ // for new cats, edge case 0 balance
      ownershipTokenCount[from]--;
      delete owlCatIndexToApproved[tokenId]; // once the token is transfered no one will still be approved
    }

    emit Transfer(from, to, tokenId);
  }

  function _safeTransfer(address _from, address _to, uint256 _tokenId, bytes memory _data) internal {
    _transfer(_from, _to, _tokenId);
    require(_checkERC721Support(_from, _to, _tokenId, _data) );
  }

  function _owns(address _claimant, uint256 _tokenId) internal view returns(bool){
    return owlCatIndexToOwner[_tokenId] == _claimant;
  }

  function approve(address _to, uint256 _tokenId) public { // II, change external for public, warning?
    require( _owns(msg.sender, _tokenId));

    _approve(_tokenId, _to);
    emit Approval(msg.sender, _to, _tokenId);
  }
  // we can have different operators for the same owner address, approve or remove 
  function setApprovalForAll(address operator, bool approved) public {  // II, change external for public, warning?
    require(operator != msg.sender);

    _operatorApprovals[msg.sender][operator] = approved;
    emit ApprovalForAll(msg.sender, operator, approved);
  }

  function getApproved(uint256 tokenId) public view returns (address){ // II, change external for public, warning?
    require(tokenId < owlCats.length); // token must exist

    return owlCatIndexToApproved[tokenId]; // return address(0) automatically if the mapping isn't set
  }

  function isApprovedForAll(address owner, address operator) public view returns (bool){ // II, change external for public, warning?
    return _operatorApprovals[owner][operator];
  }

  function _approve(uint256 _tokenId, address _approved) internal { // II
    owlCatIndexToApproved[_tokenId] = _approved;
  }

  function safeTransferFrom(address _from, address _to, uint256 _tokenId, bytes memory _data) public{ // IV, change external for public, warning?
    require( _isApprovedOrOwner(msg.sender, _from, _to, _tokenId));
    _safeTransfer(_from, _to, _tokenId, _data);
  }

  function safeTransferFrom(address _from, address _to, uint256 _tokenId) public{ // IV, change external for public, warning?
    safeTransferFrom(_from, _to, _tokenId, "");
  }

  function transferFrom(address _from, address _to, uint256 _tokenId) public{  // III, change external for public, warning?
    //require(_to != address(0));
    //require(msg.sender == _from || _approvedFor(msg.sender, _tokenId) || isApprovedForAll(_from, msg.sender));
    //require(_owns(_from, _tokenId));
    //require(_tokenId < owlCats.length);
    require(_isApprovedOrOwner(msg.sender, _from, _to, _tokenId)); // IV
    _transfer(_from, _to, _tokenId);
  }
  // if claimant have approuval then True
  function _approvedFor(address _claimant, uint256 _tokenId) internal view returns(bool){  //III
    return owlCatIndexToApproved[_tokenId] == _claimant;
  }

  function _checkERC721Support(address _from, address _to, uint256 _tokenId, bytes memory _data) internal returns (bool){ // III
    if(!_isContract(_to))
      return true;
    //Call onERC721Received in the _to contract
    bytes4 returnData = IERC721Receiver(_to).onERC721Received(msg.sender, _from, _tokenId, _data); // III
    return returnData == MAGIC_ERC721_RECEIVED; //Check return value     
  }

  function _isContract(address _to) view internal returns(bool){ // III
    //check code zize > 0 so it is a contract
    uint32 size;
    assembly{
      size := extcodesize(_to)
    }

    return size > 0;
  }

  function _isApprovedOrOwner(address _spender, address _from, address _to, uint256 _tokenId) internal view returns(bool){
    require(_tokenId < owlCats.length); // token must exist
    require(_to != address(0)); // _to address is not zero address
    require(_owns(_from, _tokenId)); // _from owns the token

    //spender is _from OR spender is approved for tokenId OR spender is operator for _from
    return (_spender == _from || _approvedFor(_spender, _tokenId) || isApprovedForAll(_from, _spender));
  }

  /* function _mixDna(uint256 _dadDna, uint256 _mumDna) internal pure returns (uint256){ // less randomness V
    // dadDna: 11 22 33 44 55 66 77 88
    // mumDna: 89 78 67 56 45 34 23 12

    uint256 firstHalf = _dadDna / 100000000; // 11223344
    uint256 secondHalf = _mumDna % 100000000; // 45342312

    // Exo: 10 concatenate to 20 => 10 * 100 = 1000 => 1000 + 20 = 1020

    uint256 newDna = firstHalf * 100000000;
    newDna = newDna + secondHalf; // 1122334445342312

    return newDna;
  } */

  function _mixDna(uint256 _dadDna, uint256 _mumDna) internal view returns (uint256){ // VI fix it
    uint256[8] memory geneArray;

    uint8 random = uint8( block.timestamp % 255 ); // 0-255 => 000000 - 11111111
    uint256 i;
    uint256 index = 7; 

    for(i = 1; i <= 128; i = i*2){
      if(random & i != 0){
        geneArray[index] = uint8( _mumDna % 100);
      }
      else{
        geneArray[index] = uint8( _dadDna % 100);
      }
      _mumDna = _mumDna / 100;
      _dadDna = _dadDna / 100;

      //index-- does not work, we don't want 00 in the last iteration
      if(i != 128){
        index = index-1;
      }
    }    

    uint256 newGene;

    for(i = 0; i < 8; i++){
      newGene = newGene + geneArray[i];
      if(i != 7){
        newGene = newGene * 100;
      }
    }

    return newGene;
  }
}
